{"query":"
    query metavault($id: ID!, $firstBlock: BigInt!, $days: Int = 7) {
  vault(id: $id) {
    totalSupply
    totalAssets
    apy
    assetPerShare
    DailyVaultStats(
      first: $days
      orderBy: timestamp
      orderDirection: desc
      where: {blockNumber_gte: $firstBlock}
    ) {
      apy
      assetPerShare
      totalAssets
      totalSupply
      timestamp
    }
    first: DailyVaultStats(first: 1, where: {blockNumber_gte: $firstBlock}) {
      apy
      assetPerShare
      totalAssets
      totalSupply
      timestamp
    }
  }
}
